import React from 'react'

const BtnBtb = props => {
    
    const content = (
        <div className={props.className}>
            <button
                className="w-full h-full bg-transparent border border-gray-900 hover:bg-gray-500 hover:bg-opacity-25 focus:outline-none focus:border-2 font-sans font-medium text-gray-900 text-sm py-2 px-4"
                type="button"
                onClick={props.onClick}>
                    {props.value}
            </button>
        </div>
    )

    return content
}

export default BtnBtb
